import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    header: {
        height: 50, width: '100%',
        backgroundColor: '#007dc6',
        justifyContent: 'center',
        flexDirection: 'row',
        marginTop: 20,
        marginBottom: 20,
    },
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
})
